import Inventory from 'pages/Inventory';
import OrderPage from 'pages/OrderPage';
import { Navigate } from 'react-router-dom';

const AdminRoutes = {
    path: '/admin',
    children: [
        {
            path: 'inventory',
            element: <Inventory />
        },
        {
            path: 'orders',
            element: <OrderPage />
        }
    ]
};

export default AdminRoutes;
